// Values.js
import React from 'react';

const values = [
  { name: 'Innovation', description: 'Always pushing boundaries and embracing new ideas.' },
  { name: 'Dedication', description: 'Committed to excellence and achieving goals.' },
  { name: 'Continuous Learning', description: 'Passionate about acquiring new knowledge and skills.' },
  // Add more values as needed
];

const Values = () => {
  return (
    <section id="value-gallery">
      {values.map((value, index) => (
        <div key={index} className="tile" data-value={value.name}>
          <h3>{value.name}</h3>
          <div className="tooltip">{value.description}</div>
        </div>
      ))}
    </section>
  );
};

export default Values;
